local CONFIG = {
    PROTECTED_NAMES = {
        "Camera",
        "NPCs",
        "Players",
        "Boats",
        "Enemies"
    },
    TRANSPARENCY_VALUE = 1, -- Max transparency (fully invisible)
    WATER_PROPERTIES = {
        WaveSize = 0,
        WaveSpeed = 0,
        Reflectance = 0,
        Transparency = 1
    },
    LIGHTING_PROPERTIES = {
        GlobalShadows = true,
        FogEnd = 1e6,
        Brightness = 1
    },
    RENDER_QUALITY = "Level01",
    DECALS_ENABLED = true,
    FPS_BOOST = {
        MATERIAL = Enum.Material.Plastic,
        SHADOWS_ENABLED = true,
        EFFECTS_ENABLED = true,
        TEXTURE_QUALITY = "Low"
    }
}

local Workspace = game:GetService("Workspace")
local Lighting = game:GetService("Lighting")
local Terrain = Workspace.Terrain

local function isProtected(object: Instance): boolean
    if not object or not object.Name then return false end
    return object == Terrain
        or object == Workspace.CurrentCamera
        or table.find(CONFIG.PROTECTED_NAMES, object.Name) ~= nil
        or object:IsA("Folder")
        or object:IsA("Player")
end

local function applyTransparency(part: Instance)
    if part:IsA("BasePart") or part:IsA("MeshPart") or part:IsA("UnionOperation") then
        if not part.Locked then
            part.Transparency = math.clamp(CONFIG.TRANSPARENCY_VALUE, 0, 1)
            part.Material = (getgenv().ShinichiXcat and getgenv().ShinichiXcat.setting and getgenv().ShinichiXcat.setting["Fps Boost"]) and CONFIG.FPS_BOOST.MATERIAL or Enum.Material.SmoothPlastic
            part.Reflectance = 0
        end
    end
end

local function disableEffects(object: Instance)
    if (object:IsA("Decal") or object:IsA("Texture")) and not CONFIG.DECALS_ENABLED then
        object.Transparency = 0.8
    elseif object:IsA("ParticleEmitter") or object:IsA("Trail") then
        object.Lifetime = NumberRange.new(0)
    elseif object:IsA("Explosion") then
        object.BlastPressure = 1
        object.BlastRadius = 1
    elseif object:IsA("Fire") or object:IsA("SpotLight") or object:IsA("Smoke") or object:IsA("Sparkles") then
        object.Enabled = false
    end
end

