    pcall(function()
        if sethiddenproperty then
            sethiddenproperty(Lighting, "Technology", (getgenv().ShinichiXcat and getgenv().ShinichiXcat.setting and getgenv().ShinichiXcat.setting["Fps Boost"]) and Enum.Technology.Compatibility or Enum.Technology.ShadowMap)
            sethiddenproperty(Terrain, "Decoration", false)
        end
        
        for prop, value in pairs(CONFIG.WATER_PROPERTIES) do
            pcall(function() Terrain["Water" .. prop] = value end)
        end
        
        for prop, value in pairs(CONFIG.LIGHTING_PROPERTIES) do
            pcall(function() Lighting[prop] = value end)
        end
        
        if getgenv().ShinichiXcat and getgenv().ShinichiXcat.setting and getgenv().ShinichiXcat.setting["Fps Boost"] then
            for _, effect in pairs(Lighting:GetChildren()) do
                if effect:IsA("PostEffect") then
                    effect.Enabled = false
                end
            end
        end
    end)
end

local function applyFpsBoost()
    if not (getgenv().ShinichiXcat and getgenv().ShinichiXcat.setting and getgenv().ShinichiXcat.setting["Fps Boost"]) then return end
    
    pcall(function()
        for _, object in Workspace:GetDescendants() do
            if (object:IsA("MeshPart") or object:IsA("BasePart")) and not isProtected(object) then
                object.TextureID = ""
                object.Material = CONFIG.FPS_BOOST.MATERIAL
            end
        end

        Lighting.GlobalShadows = CONFIG.FPS_BOOST.SHADOWS_ENABLED
        Lighting.ShadowSoftness = 0

        pcall(function() settings().Rendering.TextureQuality = CONFIG.FPS_BOOST.TEXTURE_QUALITY end)
    end)
end

local function makeMapTransparent()
    pcall(function() settings().Rendering.QualityLevel = Enum.QualityLevel[CONFIG.RENDER_QUALITY] end)
    
    optimizeLightingAndEffects()
    applyFpsBoost()
    
    local function processObjects()
        for _, object in Workspace:GetDescendants() do
            pcall(function()
                if not isProtected(object) then
                    if object:IsA("Model") then
                        for _, part in object:GetDescendants() do
                            applyTransparency(part)
                            disableEffects(part)
                        end
                    else
                        applyTransparency(object)
                        disableEffects(object)
                    end
                end
            end)
        end
    end
    
    coroutine.wrap(processObjects)()
    
    Workspace.DescendantAdded:Connect(function(object)
        if not isProtected(object) then
            applyTransparency(object)
            disableEffects(object)
        end
    end)
end

local function restoreMap()
    pcall(function()
        for _, object in Workspace:GetDescendants() do
            if (object:IsA("BasePart") or object:IsA("MeshPart") or object:IsA("UnionOperation")) and not isProtected(object) then
                object.Transparency = 0
                object.Material = Enum.Material.Plastic
            elseif object:IsA("Decal") or object:IsA("Texture") then
                object.Transparency = 0
            end
        end
        Lighting:ClearAllChildren()
        Terrain.WaterTransparency = 0
        Terrain.WaterReflectance = 0.2
    end)
end

makeMapTransparent()